from typing import List
from collections import defaultdict

class Solution:
    def findAllRecipes(self, recipes: List[str], ingredients: List[List[str]], supplies: List[str]) -> List[str]:
        def dfs(rec, seen):
            #print(rec, seen, supplies_set)
            if rec in recipes_hsh:
                return True
            if rec in supplies_set:
                return True
            if rec not in rcp_hsh:
                return False
            if rec in seen:
                return False
            seen.add(rec)
            for ing in rcp_hsh[rec]:
                if ing in supplies_set:
                    continue
                if ing not in supplies_set:
                    tmp = dfs(ing, seen)
                    if not tmp:
                        return False
            recipes_hsh[rec] = True
            supplies_set.add(rec)
            return recipes_hsh[rec]
        recipes_hsh = defaultdict(bool)
        rcp_hsh = defaultdict(list)
        supplies_set = set(supplies)
        N = len(recipes)
        for i in range(N):
            rec = recipes[i]
            ing = ingredients[i]
            rcp_hsh[rec] = ing
        res = list()
        for r in recipes:
            if dfs(r, set()):
                res.append(r)
        return res

